function app(){
<>
<h1>Calculater</h1>
    <ul>
        <li>Add : {add(40,4)}</li>
        <li>Sub : {add(40,4)}</li>
        <li>Mult : {add(40,4)}</li>
        <li>Div : {add(40,4)}</li>
    </ul>
 </> 
 return app; 

}

export default app;
